INSERT INTO `encabezados` (`ID_ENCABEZADO`, `TITULO`, `DESCRIPCION`, `TIPO_MULTIMEDIA`) VALUES
(1, '', 'encabezado nuevo', 'SIN'),
(29, '', 'Mirar el r&iacute;o hecho de tiempo y agua y recordar que el tiempo es otro r&iacute;o, saber que nos perdemos como el r&iacute;o  y que los rostros pasan como el agua.\r\n\r\nSentir que la vigilia es otro sue&ntilde;o que sue&ntilde;a no so&ntilde;ar y que la muerte que teme nuestra carne es esa muerte\r\nde cada noche, que se llama sue&ntilde;o.\r\n\r\nVer en el d&iacute;a o en el a&ntilde;o un s&iacute;mbolo de los d&iacute;as del hombre y de sus a&ntilde;os, convertir el ultraje de los a&ntilde;os\r\nen una m&uacute;sica, un rumor y un s&iacute;mbolo,\r\n\r\nver en la muerte el sue&ntilde;o, en el ocaso un triste oro, tal es la poes&iacute;a\r\nque es inmortal y pobre. La poes&iacute;a vuelve como la aurora y el ocaso.\r\n\r\nA veces en las tardes una cara  nos mira desde el fondo de un espejo;\r\nel arte debe ser como ese espejo que nos revela nuestra propia cara.\r\n\r\nCuentan que Ulises, harto de prodigios, llor&oacute; de amor al divisar su &Iacute;taca\r\nverde y humilde. El arte es esa &Iacute;taca de verde eternidad, no de prodigios.\r\n\r\nTambi&eacute;n es como el r&iacute;o interminable que pasa y queda y es cristal de un mismo\r\nHer&aacute;clito inconstante, que es el mismo y es otro, como el r&iacute;o interminable.\r\n', 'SIN'),
