(35, '', 'NUESTRA EXTRA&Ntilde;A &Eacute;POCA</br>\nWilliam Ospina</br>\nBORGES DEC&Iacute;A QUE LA DEMOCRACIA, tal como hoy la entendemos, es &#8220;ese curioso abuso de la estad&iacute;stica&#8221;.\n\nLa estad&iacute;stica, que sin duda es un instrumento valioso para entender ciertos fen&oacute;menos, se ha vuelto en nuestra &eacute;poca la piedra filosofal. Antes todo quer&iacute;an convertirlo en oro, ahora todo lo convierten en cifras. Todos los d&iacute;as nos llevan y nos traen con cifras que nos producen la ilusi&oacute;n de que todo es medi- ble, de que todo es contable, y a veces perdemos la visi&oacute;n de la complejidad de los hechos gracias a la ilusi&oacute;n de que entendemos el mundo s&oacute;lo porque conocemos sus porcentajes.\n\nCifras llenas de importancia que, por lo dem&aacute;s, cambian de d&iacute;a en d&iacute;a. Los gobernantes suben y bajan en popularidad como en una monta&ntilde;a rusa al empuje de los acontecimientos, y est&aacute;n aprendiendo que a punta de esc&aacute;ndalos, de riesgos y alarmas, es posible mantener el inter&eacute;s y hasta la aprobaci&oacute;n de la comunidad.\n\nNadie parece preguntarse si detr&aacute;s de esas cifras hay hechos profundos y datos verdaderos, si detr&aacute;s de esas alarmas cotidianas hay cambios reales, si detr&aacute;s de esos &eacute;xitos atronadores hay verdaderas transformaciones hist&oacute;ricas.\n\nRoma crey&oacute; que era posible gobernar con pan y circo. El mundo contempor&aacute;neo le est&aacute; demostrando que en esa f&oacute;rmula sobraba el pan. Vivimos en la edad del espect&aacute;culo, en la edad de la satisfacci&oacute;n inmediata, ya quieren que nadie se pregunte de d&oacute;nde viene ni para d&oacute;nde va sino s&oacute;lo cu&aacute;l es el pr&oacute;ximo movimiento, cu&aacute;l es el &uacute;ltimo acontecimiento. Las modas han reemplazado a las costumbres, las noticias a las tradiciones, los fanatismos a las religiones, la far&aacute;ndula a la pol&iacute;tica.\n\nPaul Valery dec&iacute;a que llamamos civilizaci&oacute;n a un proceso cultural por el cual la humanidad tiende a po- nerse de acuerdo sobre valores cada vez m&aacute;s abstractos. Y es verdad que all&iacute; donde las sociedades pri- mitivas luchan por la tierra, por el oro, por la acumulaci&oacute;n personal, las sociedades organizadas luchan por la libertad, por la justicia, por la igualdad de oportunidades, por la dignidad, por la legalidad.\n\nEn una sociedad primitiva, si la ley es un estorbo para alcanzar un fruto concreto, se viola la ley con arrogancia y con descaro. Ello permite logros inmediatos pero vulnera ampliamente el pacto social, deja a algunos protagonistas m&aacute;s fuertes pero a la comunidad inevitablemente m&aacute;s d&eacute;bil.\n\nHay una conspiraci&oacute;n en el mundo contra la lucidez, contra la lentitud, contra las serenas maduraciones, contra los ritmos naturales, contra el esfuerzo, contra la responsabilidad. La inteligencia, por ejemplo, es estorbosa a la hora de lograr la unanimidad: es mucho mejor la disciplina y la sumisi&oacute;n.\n\nLas cosas profundas maduran lentamente, pero ahora se quiere que todo sea &uacute;til enseguida, no viajar sino llegar, no aprender sino saber, no estudiar sino graduarse, y terminamos creyendo que vale m&aacute;s el resultado que el proceso. Si las semillas tardan en reto&ntilde;ar, piensan que hay que intervenir los pro- cesos para que las semillas revienten antes, para que la planta brote m&aacute;s pronto, para que la tierra extreme su trabajo y las cosechas se multipliquen.', 'SIN'),
