(198, '', 'CONVERSATION <br />\r\nA: Hi, Paul. How are you doing?<br />\r\nB: I’m very busy writing a report today. What about you?<br />\r\nA: I was calling to invite you to watch a movie this evening.<br />\r\nB: Well, I think I’ll finish my work by 6:00. Is that alright for you?<br />\r\nA: Actually, I have an appointment at the dentist’s so it is okay.<br />\r\nB: Let’s meet at the cinema at 7:00, then. What do you think?<br />\r\nA: I’ll be there. See you.', 'SIN'),
