(201, '', 'CONVERSATION<br />\r\nA: I need to get some groceries for my sister’s birthday dinner today and I don’t have time to goshopping. Can you help me?<br />\r\nB: Sure. I’m going shopping today. What do you need?<br />\r\nA: Let me see... Mmmmmm, I have eggs, carrots, lettuce and potatoes, too.<br />\r\nB: What about some fruit?<br />\r\nA: No. I still have some apples and pears at home.<br />\r\nB: So what can I buy for you?<br />\r\nA: Oh! I almost forgot. I need some beef and chicken.<br />\r\nB: Anything to drink?<br />\r\nA: I don’t think so. I bought enough drinks yesterday.', 'SIN'),
