(204, '', 'Benjamin Franklin<br />\r\nBenjamin Franklin was best known by his experiments with electricity, and as an influential statesman. As a young man, Benjamin Franklin tried a number of jobs in America and England. Then, back in America, he set up his own printing business, and by the age of 23 he was printing all the banknotes for Pennsylvania.<br />\r\nHe was always interested in science, and wanted to prove that lightning was just a giant electrical spark. In 1757 Franklin became the representative of Pennsylvania in London.', 'SIN'),
