(236, '', 'THE EUROTUNNEL<br />\r\nIn 1957, an engineering company started studying the possibility to join Britain and <br />\r\nFrance through a tunnel under the sea. It would have two trains for passengers as <br />\r\nwell as a small service train. In 1973 the ideas went into action and the hard work <br />\r\nbegan. A short time later, they were stopped because there wasn’t enough money <br />\r\nto complete the project.<br />\r\nIn 1984, several companies showed their ideas to re-start the project: two variations <br />\r\nof railway, a road and a big bridge over the English Channel. The chosen project <br />\r\nwas the railway solution that was very similar to the one presented back in 1973. <br />\r\nThis time with help from both the British and French, a private company began the <br />\r\nconstruction. <br />\r\nOn January 20th 1986, the company TransMancheLink (TML) said that a long tunnel <br />\r\nwould be constructed. They chose a route from Folkestone in England to Calais in <br />\r\nFrance. This wasn’t the shortest possible way and the company needed to work <br />\r\nharder than 13 years before. <br />\r\nIt took seven years to complete the Eurotunnel and about 13,000 people worked on it. <br />\r\nThe two ends of the smallest platform met on December 1st 1990 and lots of journalists <br />\r\nand photographers went to the opening ceremony. Later, in 1991 the two long trains <br />\r\nmet. The hard work continued and three years later the project was completed.', 'SIN'),
