(244, '', 'Janet&acute;s Experience<br />\r\nWhen the opportunity to work in Japan for 3 months took place, I decide to register. I did not realize the impact it would have on my life and me. The people who know me well all thought that I would not last the three months away from home and in a very different culture.<br />\r\nHow wrong the were!<br />\r\n<br />\r\nOn arriving in Tokyo, I immediately like the new environment. I surprised myself with how much I enjoyed my new way of life.<br />\r\n<br />\r\nThree colleagues from the UK joined me. We lived in the same house in an area of Tokyo called Komagome. We did not speak the Japanese language and this led to many interesting times in restaurants, on train journeys and generally getting around in Japan. Our first glance of a menu found it impossible to read so we just pointed to a few things and sat in hope. Our food arrived... and kept on arriving. Unknown to us, we had ordered enough to fee 20 people; there were only 4 of us!<br />\r\n<br />\r\nOne morning I decide to go for a run before work. I took a different way from my known route to extend the run and after 2 hours of running and trying to find my way home, I had to stop a taxi to help me get home. I told the driver I wanted to go to Komagome Station, knowing I could direct him to the house from there. I then had to try to explain that I had no money with me and had to go in to the house first to get some money to pay the taxi driver!', 'SIN'),
