(255, '', 'Jonathan&acute;s Trip to Colombia<br />\r\n<br />\r\nI went to Colombia last summer. My journey began on the Caribbean coast and ended on the border with Ecuador. Colombia is splendid country, extremely diverse and full of wonderful people. I will tell you why.<br />\r\n<br />\r\nIn South Colombia the is a city called Pereira; just outside you can find a track where you will see the farm Villa Maria - a hidden paradise that takes a long time to get to-. It is working coffee farm located in the middle of a valley. Coffee and plantain grow as far as the eye can see. The farm is made up of the house and the processing plant. The family business has guests at the house for just $45.000 a night. This includes 3 home cooked meals a day, a swimming pool, and as much coffee as you can drink. The scene is quite unbelievable. Bamboo chairs rest on the corners of the Villa, mangoes hang from the trees, parrots and birds fly wild.<br />\r\n<br />\r\nA wonderful man named Hector who runs the farm is happy to show guests around the coffee processing plant. By day, the only sounds are of the horses coming down the valley side carrying food. By night, the wildlife comes alive, and depending on the time of the year - thunderstorms offer a spectacular light show. For those who wish to escape, Villa Maria is the answer.<br />\r\n<br />\r\nThis is just one attraction of many in Colombia. I could write pages on the country and no get bored. I graduate next year and I can&acute;t wait to return to this beautiful country. Some of those reading may be stimulated to do the same.', 'SIN'),
