(7, NULL, 'Sabemos que la Tierra se mueve alrededor del Sol. Pero, ciertamente, nosotros vemos m&aacute;s claro que el d&iacute;a y la noche se forman al moverse el Sol. Aparece al amanecer por el horizonte y se oculta por el poniente. ¿Qui&eacute;n siente que es la Tierra la que da una vuelta completa alrededor de s&iacute; misma en veinticuatro horas, creando as&iacute; el d&iacute;a y la noche? ¿Nos estar&aacute;n enga&ntilde;ando nuestros sentidos? ¿Nos estaremos equivocando al conocer nuestro mundo, al pensar, al creer que existimos, al hablar? Este es el punto que trata esta parte de la filosof&iacute;a: saber si nuestro conocimiento es verdadero, investigar si los resultados de la ciencia no nos enga&ntilde;an [...] La f&iacute;sica, la qu&iacute;mica, nuestro conocimiento del mundo, nuestra capacidad de pensar, cuelgan de un hilo; del hilo de la Epistemolog&iacute;a. En el texto, la intenci&oacute;n b&aacute;sica del autor es', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(8, NULL, 'Mirar el r&iacute;o hecho de tiempo y agua y recordar que el tiempo es otro r&iacute;o, saber que nos perdemos como el r&iacute;o  y que los rostros pasan como el agua.  Sentir que la vigilia es otro sue&ntilde;o que sue&ntilde;a no so&ntilde;ar y que la muerte que teme nuestra carne es esa muerte de cada noche, que se llama sue&ntilde;o.  Ver en el d&iacute;a o en el a&ntilde;o un s&iacute;mbolo de los d&iacute;as del hombre y de sus a&ntilde;os, convertir el ultraje de los a&ntilde;os en una m&uacute;sica, un rumor y un s&iacute;mbolo,  ver en la muerte el sue&ntilde;o, en el ocaso un triste oro, tal es la poes&iacute;a que es inmortal y pobre. La poes&iacute;a vuelve como la aurora y el ocaso.  A veces en las tardes una cara  nos mira desde el fondo de un espejo; el arte debe ser como ese espejo que nos revela nuestra propia cara.  Cuentan que Ulises, harto de prodigios, llor&oacute; de amor al divisar su &Iacute;taca verde y humilde. El arte es esa &Iacute;taca de verde eternidad, no de prodigios.  Tambi&eacute;n es como el r&iacute;o interminable que pasa y queda y es cristal de un mismo Her&aacute;clito inconstante, que es el mismo y es otro, como el r&iacute;o interminable. Tomado de: Garc&iacute;a Maffla, Jaime. Antolog&iacute;a de poes&iacute;a colombiana e hispanoamericana. Jorge Luis Borges. Bogot&aacute;, Colombia: Editorial Panamericana. pp. 240-241. A partir de lo expresado en la segunda estrofa y en relaci&oacute;n con el sentido global del poema, se puede inferir que, para el autor, el temor de la muerte es', 'TEXTO', 'SIN EXPLICACIÓN', '', 1, 1, 1),
