(73, NULL, 'La gonorrea es una enfermedad de transmisi&oacute;n sexual causada por una bacteria que comienza a multiplicarse en la uretra y de all&iacute; se extiende a los &oacute;rganos reproductores. Si una persona toca sus genitales infectados y por casualidad se toca los ojos, puede presentarse una infecci&oacute;n que conduce a la ceguera. ¿Cu&aacute;l de los siguientes comportamientos evitar&iacute;a que un enfermo de gonorrea transmita esta bacteria a los ojos de sus familiares?', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(86, NULL, 'Entre los a&ntilde;os de 1845 y 1852, todos los cultivos de papa de la isla de Irlanda fueron destruidos por una enfermedad producida por un hongo. Dos factores contribuyeron a la alta dispersi&oacute;n de la enfermedad: (1) en Irlanda se cultivaba &uacute;nicamente una variedad de papa y (2) los cultivos de papa se encontraban aislados del resto del mundo, por lo cual se reproduc&iacute;an &uacute;nicamente entre s&iacute;. Desde un punto de vista gen&eacute;tico, estos dos factores contribuyeron a la dispersi&oacute;n de la enfermedad, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(87, NULL, 'El alcohol es una sustancia que puede generar dependencia en las personas que lo consumen, inhibe la producci&oacute;n de gl&oacute;bulos blancos, genera un deterioro de las mucosas del sistema digestivo, incrementa la actividad cardiaca y altera la acci&oacute;n de algunos neurotransmisores. De acuerdo con lo anterior, ¿cu&aacute;l de las siguientes alteraciones en la salud, estar&iacute;a relacionada con el consumo excesivo de alcohol?', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(88, NULL, 'Las sales solubles de plomo son t&oacute;xicas y se acumulan en los tejidos de los organismos que las ingieren con regularidad. En una red tr&oacute;fica, los efectos del plomo son m&aacute;s severos en los hombres y otros animales del mismo nivel tr&oacute;fico que en las plantas o los herb&iacute;voros. Esto sucede porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(89, NULL, 'Durante la fotos&iacute;ntesis, los estomas en las hojas permanecen abiertos el tiempo suficiente para captar di&oacute;xido de carbono, lo que a su vez genera una p&eacute;rdida de agua por transpiraci&oacute;n. Los espacios que deja el agua transpirada tienen que ocuparse nuevamente por mol&eacute;culas de agua nuevas, que ascienden a las hojas desde las ra&iacute;ces a trav&eacute;s del xilema. Seg&uacute;n esta informaci&oacute;n, se puede afirmar que los estomas son importantes en el proceso de nutrici&oacute;n de las plantas, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
