(97, NULL, 'Los adelantos cient&iacute;ficos han permitido grandes desarrollos en los computadores y los sistemas inform&aacute;ticos. De hecho, algunos defensores de la llamada inteligencia artificial sostienen que en la actualidad los computadores pueden simular todas y cada una de las actividades mentales que realizan los seres humanos, atrevi&eacute;ndose a decir que las m&aacute;quinas m&aacute;s avanzadas, por ejemplo aquellas programadas para jugar ajedrez, efectivamente piensan. Una de las razones que se tiene para criticar esta posici&oacute;n es aquella seg&uacute;n la cual:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(98, NULL, 'Seg&uacute;n Plat&oacute;n, el alma, en tanto que es inmortal, es una especie de recipiente de la memoria en donde se almacenan los conocimientos de vidas pasadas. De acuerdo con lo anterior, se puede afirmar que para este autor conocer es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(99, NULL, 'La pregunta por el mal que existe en el mundo recorre la historia de la tradici&oacute;n filos&oacute;fica. Una de las respuestas m&aacute;s frecuentes dadas por los fil&oacute;sofos a este interrogante es el:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(100, NULL, 'La pregunta por el objeto de una ciencia implica distinguir entre objeto material y objeto formal. Se entiende por objeto material lo que estudia la ciencia, y por objeto formal el modo como esa ciencia estudia el objeto material. Teniendo en cuenta la anterior distinci&oacute;n, puede deducirse que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(101, NULL, 'Thomas Kuhn sostiene que hoy puede ser verdad algo para la ciencia, pero el d&iacute;a de ma&ntilde;ana podr&iacute;a no serlo. As&iacute;, durante mucho tiempo se tuvo por cierto que el Sol giraba en torno a la Tierra, pero a partir de los estudios de Galileo, Cop&eacute;rnico y Kepler, se estableci&oacute; lo contrario. De acuerdo con esto, la:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(102, NULL, 'Seg&uacute;n algunas doctrinas filos&oacute;ficas, la verdad se caracteriza por su cualidad de universalidad y debe radicar en la concordancia del pensamiento consigo mismo. Este planteamiento se derrumba al sostener que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(103, NULL, 'La discusi&oacute;n sobre el concepto del mal ha sido abordada desde diversas perspectivas a lo largo de la historia de la filosof&iacute;a. Por ejemplo, en la &eacute;poca medieval el problema del mal se entend&iacute;a desde un punto de vista ontol&oacute;gico, es decir, se cre&iacute;a que exist&iacute;a como una fuerza universal que influ&iacute;a en la din&aacute;mica del mundo y que corromp&iacute;a la voluntad de los hombres. En la actualidad, el problema se aborda de manera diferente y muchos fil&oacute;sofos ubican el mal en las decisiones conscientes que toman los seres humanos y en las consecuencias a las que pueden llevar sus acciones. Con lo anterior se quiere decir que m&aacute;s que ser un problema ontol&oacute;gico, el mal es un problema &eacute;tico. Para poder sostener esta &uacute;ltima afirmaci&oacute;n es necesario entender:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(104, NULL, 'Para Arist&oacute;teles, el hombre es un animal pol&iacute;tico. Esto quiere decir que el hombre por naturaleza busca la asociaci&oacute;n con sus semejantes. Seg&uacute;n lo anterior, la:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(105, NULL, '"No toda apariencia indica una realidad", esto permite concluir que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
