(107, NULL, 'Seg&uacute;n Tomas Kuhn (1957), la concepci&oacute;n helioc&eacute;ntrica del universo (copernicana), ligada a la nueva doctrina planetaria, sirvi&oacute; como instrumento para dar paso de la Edad Media a la sociedad occidental moderna, en raz&oacute;n de que con &eacute;sta:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(108, NULL, 'Se conoce con el nombre de intelectualismo a aquella postura &eacute;tica que supone que no existen un bien y un mal absolutos, como realidades universales opuestas que condicionan previamente la acci&oacute;n humana, sino que s&oacute;lo existen distintos niveles de conocimiento que conducen al hombre a una mayor o menor libertad, en la medida en que cada cual desarrolle su propio pensamiento. De acuerdo con lo anterior se puede sostener que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(109, NULL, 'El m&eacute;todo cient&iacute;fico (observaci&oacute;n, hip&oacute;tesis, experimentaci&oacute;n y demostraci&oacute;n) le permiti&oacute; a la ciencia prever futuros comportamientos, reacciones, etc&eacute;tera, del mundo f&iacute;sico. Esto lo hizo acreedor de un gran reconocimiento en la &eacute;poca moderna, tanto as&iacute;, que posteriormente las ciencias humanas quisieron adoptarlo para analizar al hombre. Sin embargo, esto no llev&oacute; a los resultados esperados, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(110, NULL, 'Kant efect&uacute;a un giro importante en el conocimiento, conocido como el &#8220;giro copernicano&#8221;. Este cambio consiste en atribuirle al sujeto pensante la capacidad de determinar el objeto conocido. De acuerdo con esto, puede afirmarse que el:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(111, NULL, 'Seg&uacute;n Plat&oacute;n, las palabras s&oacute;lo tienen sentido si hacen referencia fielmente a las cosas y a las relaciones entre &eacute;stas. Se concluir&iacute;a, entonces, siguiendo este planteamiento, que una forma de expresi&oacute;n conflictiva ser&iacute;a la:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(112, NULL, 'Seg&uacute;n muchos fil&oacute;sofos antiguos, lo que tienen en com&uacute;n todas las cosas es el ser, pero el ser est&aacute; m&aacute;s all&aacute; de lo que se capta por los sentidos. Seg&uacute;n este planteamiento, se puede deducir que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(113, NULL, 'Plat&oacute;n considera que el hombre est&aacute; constituido por cuerpo y alma, entidades que pueden   separarse.   Este   planteamiento puede refutarse, siguiendo a Arist&oacute;teles, al sostener que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(114, NULL, 'En el m&eacute;todo inductivo se parte de la observaci&oacute;n de las cosas particulares para llegar a ideas o leyes generales. Por tanto, la afirmaci&oacute;n &#8220;a partir de la ley de la gravedad se deduce que todo cuerpo que se lanza para arriba cae&#8221; NO corresponde al m&eacute;todo inductivo, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
(115, NULL, 'El ser es lo com&uacute;n a todo lo que hay en la naturaleza, en el mundo, en la realidad. En otras palabras, el ser es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 2, 1, 1),
