(124, NULL, 'La digesti&oacute;n de alimentos vegetales es m&aacute;s compleja que la de alimentos de origen animal. Al observar la longitud del <br />\r\nintestino de renacuajos de dos especies se observ&oacute; que el de la especie 1 es m&aacute;s larga que el de la especie 2. A partir de <br />\r\nesta informaci&oacute;n se podr&iacute;a pensar que posiblemente los renacuajos', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
