(128, NULL, 'Durante el ciclo menstrual hay una enorme variaci&oacute;n en la concentraci&oacute;n de ciertas hormonas en la sangre. Dos de esas <br />\r\nhormonas, el estr&oacute;geno y la progesterona, tienen efectos antag&oacute;nicos, es decir, cuando hay altas concentraciones de una de <br />\r\nellas ocurre algo opuesto a cuando hay altas concentraciones de la otra. Se sabe que una de las funciones de la <br />\r\nprogesterona es engrosar el endometrio prepar&aacute;ndolo para que el &oacute;vulo reci&eacute;n fecundado pueda anidarse. Un m&eacute;todo <br />\r\nanticonceptivo com&uacute;n consiste en aumentar artificialmente los niveles de estr&oacute;geno durante el ciclo menstrual. Este m&eacute;todo <br />\r\nresulta ser muy efectivo porque el estr&oacute;geno', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(129, NULL, 'Dentro de la estructura del bosque existen &aacute;rboles que emergen sobre los otros y reciben la luz directa, mientras que los <br />\r\nm&aacute;s peque&ntilde;os habitan en las partes bajas, donde la cantidad de luz es menor. Estas plantas de sombra deben poseer <br />\r\nalgunas caracter&iacute;sticas que les permita fabricar su alimento a pesar de la restricci&oacute;n lum&iacute;nica. Algunas de estas <br />\r\ncaracter&iacute;sticas pueden ser', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(130, NULL, 'Algunas sustancias adictivas estimulantes no permiten que los neurotransmisores liberados en una sinapsis vuelvan a la <br />\r\nneurona de origen. En personas adictas a la coca&iacute;na, por ejemplo, esto se manifiesta en estados de euforia de larga <br />\r\nduraci&oacute;n producto del paso prolongado de impulsos nerviosos de una neurona a otra. Algunos neurot&oacute;xicos presentes en la <br />\r\npiel de ciertos animales producen un efecto similar al de los estimulantes, pero act&uacute;an en las uniones neurona-m&uacute;sculo. Si <br />\r\nun rat&oacute;n es inyectado con una cantidad suficiente de estas neurotoxinas, podr&iacute;a esperarse que experimente', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(131, NULL, 'En experimentos con arvejas se descubri&oacute; que el color rojo de las flores era dominante sobre el blanco y que las semillas <br />\r\nlisas eran dominantes sobre las rugosas. Los posibles fenotipos de los hijos que se podr&iacute;an obtener al cruzar una planta <br />\r\nblanca de semillas rugosas con una roja de semillas lisas que es heterocigota para estas dos caracter&iacute;sticas, son:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(132, NULL, 'Los mam&iacute;feros y las aves utilizan pelos y plumas para guardar el calor, a manera de un saco de lana que utilizamos en <br />\r\nclima fr&iacute;o. Adem&aacute;s, bajo el plumaje o los pelos estos animales acumulan grasas que cumplen una funci&oacute;n similar. Los lobos <br />\r\nson mam&iacute;feros que se pueden encontrar en varios climas. Pensando en los efectos del clima sobre la forma del cuerpo se <br />\r\nesperar&iacute;a encontrar las siguientes diferencias entre lobos de diferentes sitios', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(133, NULL, 'Entre las siguientes afirmaciones sobre la nutrici&oacute;n de las plantas, aquella con la que estar&iacute;a de acuerdo es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(134, NULL, 'Se tienen dos sitios: A y B. El sitio A se caracteriza por presentar una estructura de vegetaci&oacute;n similar a una selva con <br />\r\nmuchos &aacute;rboles de diferentes alturas. El agua en este sitio se encuentra a unos 30 cm. de profundidad. El sitio B presenta <br />\r\nuna estructura de sabana, es decir, una llanura con gran cantidad de hierbas y muy pocos &aacute;rboles. El nivel del agua en este <br />\r\nsitio se encuentra a unos 70 cm. de profundidad. Se sabe que existe una especie de planta que puede crecer en ambos <br />\r\nsitios. En A se ubica en la parte m&aacute;s baja del bosque, y en B crece como un arbusto. A partir de la informaci&oacute;n podr&iacute;a <br />\r\npensarse que esta especie de planta tendr&iacute;a las siguientes caracter&iacute;sticas:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(135, NULL, 'Los tropismos son respuestas de crecimiento, cuya direcci&oacute;n depende de la fuente productora del est&iacute;mulo. Lo que <br />\r\npodr&iacute;amos esperar del crecimiento de una planta joven que se desarrolla normalmente en la matera de una casa y que, por <br />\r\naccidente, ha ca&iacute;do de lado permaneciendo algunas semanas en esta posici&oacute;n es que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(136, NULL, 'Las t&eacute;cnicas modernas de la biolog&iacute;a molecular nos permiten reemplazar el n&uacute;cleo de un &oacute;vulo fecundado por el n&uacute;cleo <br />\r\nde una c&eacute;lula som&aacute;tica de un organismo adulto. Al implantar este &oacute;vulo en el &uacute;tero de una hembra de la especie el resultado <br />\r\nm&aacute;s probable ser&aacute; un organismo:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(137, NULL, 'En un bosque, una especie vegetal es polinizada &uacute;nicamente por una abeja, de tal forma que este insecto es el &uacute;nico <br />\r\nmedio que tiene el polen de las flores masculinas para llegar a los ovarios de las flores femeninas. Si se siembran individuos <br />\r\nde estas plantas en un sitio donde la abeja no existe se esperar&iacute;a que la reproducci&oacute;n de estos individuos se vieran <br />\r\nafectados en que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(138, NULL, 'Un pez de agua dulce mantiene la concentraci&oacute;n de solutos en su sangre un poco m&aacute;s alta que la de su medio. Este pez <br />\r\nes llevado a un estanque de agua marina, en donde se esperar&aacute; que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(139, NULL, 'Cuando los cet&aacute;ceos como los delfines y ballenas salen a la superficie expulsan un chorro de aire h&uacute;medo que contiene <br />\r\nentre otras sustancias, gases, vapor de agua y mucus; la funci&oacute;n de esta acci&oacute;n es eliminar algunos productos de los <br />\r\nprocesos respiratorios tales como el:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(140, NULL, 'La gastrina y la secretina son dos hormonas implicadas en la regulaci&oacute;n del pH en el sistema digestivo humano. La <br />\r\ngastrina estimula la producci&oacute;n de &aacute;cido clorh&iacute;drico en el est&oacute;mago mientras que la secretina estimula la secreci&oacute;n de <br />\r\nbicarbonato por el p&aacute;ncreas. El bicarbonato a su vez, neutraliza la acci&oacute;n del &aacute;cido al nivel duodenal. Si en un momento <br />\r\ndeterminado el pH al nivel del duodeno es de 2,5 se podr&iacute;a esperar que el organismo respondiera:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(141, NULL, 'A medida que aument&oacute; la poblaci&oacute;n Colombiana y se requiri&oacute; m&aacute;s espacio para asentamientos humanos, la gente se fue desplazando hacia las &aacute;reas boscosas, reemplazando as&iacute; la vegetaci&oacute;n nativa por cultivos y pastos para el ganado. Como <br />\r\nresultado las grandes extensiones de bosque se dividieron en fragmentos peque&ntilde;os, separados entre s&iacute;. Los grandes <br />\r\ncarn&iacute;voros del bosque como jaguares, tigres y &aacute;guilas realizan grandes desplazamientos diariamente en busca de presas <br />\r\ngeneralmente dif&iacute;ciles de encontrar. El hecho frecuente de que estos animales visiten fincas con animales dom&eacute;sticos para alimentarse de ellos, luego de que ha ocurrido la fragmentaci&oacute;n de un bosque como causa de las actividades humanas, se puede atribuir a que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 6, 4, 6),
(142, NULL, 'Una prueba atl&eacute;tica tiene un r&eacute;cord mundial de 10,49 segundos y un r&eacute;cord ol&iacute;mpico de 10,50 segundos. ¿Es posible que un atleta registre un tiempo, en el mismo tipo de prueba, que rompa el r&eacute;cord ol&iacute;mpico pero no el mundial?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(143, NULL, 'Un trapecio is&oacute;sceles es un cuadril&aacute;tero que tiene un solo par de lados paralelos y los otros dos, de igual medida.<br />\r\nEn un plano cartesiano se dibuja un trapecio is&oacute;sceles de modo que el eje Y divide al trapecio en dos figuras iguales.<br />\r\nS&iacute; las coordenadas de dos de los v&eacute;rtices del trapecio son (-4,2) y (-2,8) ¿Cuales son las coordenadas de los otros dos v&eacute;rtices? ', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(144, NULL, 'Sobre una circunferencia de centro O se localizan dos puntos P y P’ diferentes.<br />\r\nDe las siguientes, ¿cu&aacute;l figura NO puede re- sultar al unir entre s&iacute; los puntos P, P’ y O?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(145, NULL, 'Un colegio necesita enviar 5 estudiantes como representantes a un foro sobre la contaminaci&oacute;n del medio ambiente. Se decidi&oacute; que 2 estudiantes sean de grado d&eacute;cimo y 3 de grado und&eacute;cimo. En d&eacute;cimo hay 5 estudiantes preparados para el foro y en und&eacute;cimo hay 4. ¿Cu&aacute;ntos grupos diferentes pueden formarse para enviar al foro?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(146, NULL, 'Entre los 16 estudiantes de un sal&oacute;n de clases se va a rifar una boleta para ingresar a un parque de diversiones. Cada estudiante debe escoger un n&uacute;mero del 3 al 18. El sorteo se efect&uacute;a de la si- guiente manera: se depositan 6 balotas en una urna, cada una numerada del 1 al 6; se extrae una balota, se mira el n&uacute;mero y se vuelve a depositar en la urna. El experimento se repite dos veces m&aacute;s. La suma de los tres puntajes obtenidos determina el n&uacute;mero ganador de la rifa. Si en la primera ex- tracci&oacute;n del sorteo se obtuvo 2, es m&aacute;s probable que el estudiante que escogi&oacute; el n&uacute;mero 10 gane la rifa a que la gane el estudiante con el n&uacute;mero 7, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(147, NULL, 'La acci&oacute;n de tutela es un mecanismo que busca la protecci&oacute;n inmediata de los derechos fundamentales de los ciudadanos. Por tanto, esta se puede presentar ante un juez cuando:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(148, NULL, 'En las principales ciudades del mundo moderno est&aacute; produci&eacute;ndose un paulatino abandono de las zonas residenciales del centro urbano, al tiempo que las zonas perif&eacute;ricas tienden a un mayor poblamiento. Estas migraciones las realizan personas o familias que tienen ingresos medios y altos. La principal causa de este fen&oacute;meno se atribuye:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(149, NULL, 'En Colombia, la discriminaci&oacute;n de personas con orientaci&oacute;n sexual diferente a la heterosexual, es decir, lesbianas, homosexuales, bisexuales y transg&eacute;neristas, ha llevado a procesos de movilizaci&oacute;n y acciones afirmativas de estas comunidades por la defensa de sus derechos. Estas movilizaciones y acciones que visibilizan a personas con orientaci&oacute;n sexual diferente a la general, son fundamentales en el desarrollo de la igualdad y del respeto por la diferencia, porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 5, 3, 5),
(150, NULL, 'La  Revoluci&oacute;n  Industrial  se  debi&oacute;, entre otras causas, a la invenci&oacute;n de la m&aacute;quina de vapor y la concentraci&oacute;n del capital, que permiti&oacute; adquirir m&aacute;quinas para producir en masa. Esta revoluci&oacute;n produjo cambios en la poblaci&oacute;n, se pas&oacute; de la explotaci&oacute;n de la tierra a la producci&oacute;n de bienes, del telar familiar a la gran f&aacute;brica y de la manufactura a la producci&oacute;n tecnificada. De acuerdo con lo anterior, se puede afirmar que una de las consecuencias de esta revoluci&oacute;n, respecto a la poblaci&oacute;n, fue el:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(151, NULL, 'Se dice que una Constituci&oacute;n es la ley de leyes, la fuente de toda la jurisprudencia en un Estado de derecho. Por esta raz&oacute;n, cada una de las normas que se expidan debe ajustarse a los principios y mandatos constitucionales. En consonancia con lo anterior, una Constituci&oacute;n sirve principalmente para:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(152, NULL, 'Un estudio revel&oacute; que el 30% de las mujeres en Colombia son v&iacute;ctimas de violencia f&iacute;sica. A partir de este estudio varias organizaciones feministas solicitaron el endurecimiento de las penas para las personas que ejerc&iacute;an violencia contra las mujeres. Ante esta petici&oacute;n un funcionario del gobierno se&ntilde;al&oacute; que el estudio no era confiable, porque no consideraba los distintos contextos de estas agresiones y que era muy importante tener en cuenta la justificaci&oacute;n de los hechos. <br />\r\nSeg&uacute;n la informaci&oacute;n presentada, la posici&oacute;n del funcionario podr&iacute;a tener como consecuencia que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(154, NULL, 'En una regi&oacute;n de Colombia, una organizaci&oacute;n estatal promueve proyectos de agricultura para la reintegraci&oacute;n de campesinos desplazados. Con este objetivo, se propone la utilizaci&oacute;n de unos terrenos que forman parte de un ecosistema de humedal. Una organizaci&oacute;n ambientalista rechaza esta decisi&oacute;n porque afectar&aacute; este ecosistema<br />\r\nDe lo que busca cada una de las organizaciones mencionadas se puede afirmar que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(155, NULL, 'La crisis econ&oacute;mica que se desat&oacute; en 1929, en Estados Unidos, tambi&eacute;n afect&oacute; a los pa&iacute;ses latinoamericanos al reducirse sus exportaciones y, por consiguiente, sus importaciones. Para contrarrestar el efecto de esta crisis, los estados latinoamericanos adoptaron medidas como la sustituci&oacute;n de importaciones, que consisti&oacute; en:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5);
INSERT INTO `preguntas` (`CODPREGUNTA`, `ID_ENCABEZADO`, `ENUNCIADO`, `TIPO_OPCIONES`, `TIPO_EXPLICACION`, `EXPLICACION`, `CODCOMPONENTE`, `CODAREA`, `CODCOMPETENCIA`) VALUES
(156, NULL, 'Algunas  tendencias  del  liberalismo promueven cobrar m&aacute;s impuestos a la<br />\r\nparte de la poblaci&oacute;n que posee m&aacute;s recursos, y menos impuestos a aquellas personas que posean menos. ¿Cu&aacute;l de las siguientes situaciones est&aacute; de acuerdo con lo anterior?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(157, NULL, 'El socialismo busca la igualdad social, pol&iacute;tica y econ&oacute;mica. Para alcanzar este prop&oacute;sito el socialismo propone:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(159, NULL, 'Un programa impulsado por pa&iacute;ses europeos lleva varios a&ntilde;os apoyando a j&oacute;venes bogotanos de estratos 1, 2 y 3 con buen manejo del ingl&eacute;s, para que creen sus propios negocios. Despu&eacute;s de 5 a&ntilde;os de operaci&oacute;n, detectan que el 30% de los negocios son restaurantes de comida internacional, 30% salones de belleza, 20% tiendas de ropa formal, 10% librer&iacute;as y 10% escuelas de baile. Ante el &eacute;xito del proyecto, deciden abrir una convocatoria para replicar el modelo en Riohacha, Leticia, Arauca y Florencia. Basados en la experiencia bogotana, establecieron que en cada ciudad deb&iacute;an apoyarse las mismas tipolog&iacute;as de negocio y en los mismos porcentajes. Probablemente implementar este mismo modelo en estas ciudades, no resulte pertinente porque en ellas', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(160, NULL, 'En 1994, como parte del proceso de paz entre el gobierno israel&iacute; y la Organizaci&oacute;n para la Liberaci&oacute;n de Palestina (OLP), se llevaron a cabo los acuerdos de Oslo. La Autoridad Nacional Palestina se cre&oacute; como un interlocutor v&aacute;lido que representaba los intereses de esta naci&oacute;n. Sin embargo, Palestina no se reconoce como un Estado propiamente dicho porque:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(161, NULL, 'El Consejo Acad&eacute;mico de un colegio decidi&oacute; nombrar como representantes al Consejo Estudiantil a los estudiantes con mejor desempe&ntilde;o acad&eacute;mico y de convivencia, en lugar de realizar las elecciones ordinarias.<br />\r\nDe esta decisi&oacute;n se puede afirmar que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(162, NULL, 'El gobierno decidi&oacute; construir una represa que es indispensable para generar electricidad para todo el pa&iacute;s. La represa solo puede construirse en un sitio en el que hay un asentamiento ind&iacute;gena. En principio, al hacer las consultas respectivas con esta comunidad, ellos se negaban a la construcci&oacute;n de la represa. Sin embargo, despu&eacute;s de un largo proceso de conciliaci&oacute;n con la comunidad, se acord&oacute; la construcci&oacute;n de la represa y que los ind&iacute;genas se asentaran en otro territorio.<br />\r\nSeg&uacute;n la Constituci&oacute;n pol&iacute;tica de Colombia, en esta situaci&oacute;n el gobierno:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(164, NULL, 'Un profesor universitario sostiene que cuando sus estudiantes mujeres responden a una pregunta, se extienden demasiado en la respuesta. Por esa raz&oacute;n, cuando les pregunta a los estudiantes y algunos levantan la mano para responder, hombres y mujeres por igual, el profesor solo les da la palabra a los hombres.<br />\r\nDe acuerdo con la Constituci&oacute;n, el profesor:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(165, NULL, 'Una compa&ntilde;&iacute;a petrolera identific&oacute; un yacimiento de petr&oacute;leo en una zona en la que vive una comunidad ind&iacute;gena para la cual extraer el petr&oacute;leo significa &#8220;robarle la sangre a la madre tierra&#8221;, y por ello se opone a la explotaci&oacute;n del yacimiento. La compa&ntilde;&iacute;a invirti&oacute; muchos recursos en un proceso de di&aacute;logo con los representantes de la comunidad, pero fue imposible llegar a un acuerdo. Ante esto, y despu&eacute;s de un an&aacute;lisis detenido de las posiciones, el Estado le neg&oacute; a la empresa el permiso de explotaci&oacute;n.<br />\r\nLa raz&oacute;n que mejor sustenta esta decisi&oacute;n es que, de acuerdo con la Constituci&oacute;n, el Estado debe:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(166, NULL, 'En un peri&oacute;dico de la ciudad han aparecido continuamente titulares como los siguientes:<br />\r\n&#8220;El alcalde no es capaz de solucionar el problema de criminalidad en la ciudad&#8221;, &#8220;Al alcalde le queda grande erradicar el crimen de la ciudad&#8221; y &#8220;La ciudad y la Alcald&iacute;a est&aacute;n sometidas a los criminales&#8221;.<br />\r\nAntes de creer que el alcalde est&aacute; haciendo mal su trabajo en materia de seguridad, ¿qu&eacute; deber&iacute;an revisar los ciudadanos principalmente?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(167, NULL, 'El problema del tr&aacute;fico de drogas il&iacute;citas ha generado que gobernantes, acad&eacute;micos y miembros de la sociedad civil de pa&iacute;ses productores debatan sobre el asunto con el fin de encontrar soluciones. Algunos proponen que, para defender el bien com&uacute;n, se debe legalizar las drogas. ¿Cu&aacute;l de los siguientes es el argumento m&aacute;s a fin con la propuesta de legalizaci&oacute;n?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(168, NULL, 'La violencia sexual contra las mujeres es un problema mundial. Hace poco tiempo, el jefe de polic&iacute;a de una ciudad muy importante, en un pa&iacute;s desarrollado, declar&oacute; al respecto: &#8220;Para evitar estas situaciones, lo mejor ser&iacute;a que las mujeres dejaran de salir con minifaldas o escotes provocadores a la calle. As&iacute; evitar&iacute;an ser v&iacute;ctimas de acoso o violencia sexual&#8221;. ¿Qu&eacute; intereses est&aacute; favoreciendo esta declaraci&oacute;n?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(169, NULL, 'Ante los crecientes robos a residencias en algunos sectores de estratos altos de una ciudad, el alcalde est&aacute; considerando autorizar el cerramiento de grandes sectores residenciales que agrupan varios barrios de la ciudad, para que sean vigilados por seguridad privada y para que solo se permita la entrada a los residentes o a personas autorizadas por estos. A la hora de evaluar la propuesta, ¿qu&eacute; intereses en conflicto deben ser tenidos en cuenta?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(170, NULL, 'La Corte Constitucional fall&oacute; a favor de un soldado que hab&iacute;a interpuesto una tutela al considerar que la instituci&oacute;n militar no le respetaba el derecho a la objeci&oacute;n de conciencia, porque su religi&oacute;n le proh&iacute;be el uso de armas y las pr&aacute;cticas militares. El fundamento del fallo es la defensa de la libertad de conciencia del soldado.<br />\r\n¿Cu&aacute;l de las siguientes acciones es coherente con este fallo?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(171, NULL, 'Durante las &eacute;pocas de lluvias, en muchas zonas rurales de Colombia se inundan escuelas y se interrumpen los caminos para llegar a estas.<br />\r\n¿Cu&aacute;l de las siguientes opciones vulnera m&aacute;s claramente el derecho a la educaci&oacute;n?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(172, NULL, 'Pek&iacute;n y otras partes de China sufren de elevados niveles de contaminaci&oacute;n. Debido a la contaminaci&oacute;n en Pek&iacute;n, algunos d&iacute;as las autoridades cancelan las actividades deportivas en el exterior en colegios y guarder&iacute;as y recomiendan a ni&ntilde;os y ancianos que no salgan a la calle. Aunque se han cerrado centenares de f&aacute;bricas en la capital y en otros puntos del pa&iacute;s, la situaci&oacute;n no mejora. Los expertos consideran que la &uacute;nica soluci&oacute;n es que la segunda econom&iacute;a mundial reduzca de forma paulatina su dependencia de las industrias pesadas y apueste por un modelo de energ&iacute;a mixta. Las industrias pesadas, entre ellas los sectores de la construcci&oacute;n y el manufacturero, aportaron el 46 por ciento del Producto Interior Bruto (PIB) en 2012. "China deber&iacute;a rebajar esta cifra hasta 9 puntos porcentuales entre 2013 y 2030 si quiere cumplir su objetivo de reducci&oacute;n de la contaminaci&oacute;n", se&ntilde;ala un experto.<br />\r\nEn esta situaci&oacute;n, ¿cu&aacute;les dimensiones est&aacute;n en conflicto?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(173, NULL, 'Un estudiante se intoxic&oacute; con comida que compr&oacute; a un vendedor ambulante a la salida del colegio. Por esto, el Consejo Directivo del colegio, con la ayuda de la Polic&iacute;a, logr&oacute; la expulsi&oacute;n de los vendedores ambulantes del sector. De los siguientes, ¿cu&aacute;l ser&iacute;a un efecto de la expulsi&oacute;n de los vendedores?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(174, NULL, 'En una especie de pato se pueden encontrar individuos con cuello corto e individuos con cuello largo. En esta especie se encuentran una mayor cantidad de patos con cuello largo. En un experimento se aparearon una hembra y un macho de cuello largo; de sus hijos 3/4 son de cuello largo y 1/4 son de cuello corto.<br />\r\nDe  los  genotipos  de  los  padres  puede afirmarse que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 4, 6),
(175, NULL, 'La polilla grande de la cera es un pat&oacute;geno que mata las larvas de las abejas y causa grandes p&eacute;rdidas econ&oacute;micas a los apicultores de todo el mundo, por la gran cantidad de panales que destruye. Seg&uacute;n la informaci&oacute;n anterior, ¿cu&aacute;l de las siguientes preguntas est&aacute; relacionada con la problem&aacute;tica descrita y puede resolverse mediante una investigaci&oacute;n en el campo de las ciencias naturales?', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(176, NULL, 'Unos estudiantes analizaron el agua de un r&iacute;o y encontraron que conten&iacute;a altos niveles de cadmio y plomo, que son metales t&oacute;xicos. Al estudiar el origen de la contaminaci&oacute;n descubrieron que los metales proven&iacute;an de filtraciones de la descomposici&oacute;n de pilas en un botadero de basura cercano. Los estudiantes proponen que a futuro se deber&iacute;an separar las pilas del resto de los desechos en contenedores completamente aislados. Con base en la informaci&oacute;n anterior, se puede afirmar que la propuesta de los estudiantes es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 4, 3, 5),
(177, NULL, 'Sobre la superficie terrestre el per&iacute;odo de oscilaci&oacute;n de un p&eacute;ndulo es T. Se lleva ese p&eacute;ndulo a un planeta en donde su per&iacute;odo de oscilaci&oacute;n es igual a 2T. La aceleraci&oacute;n gravitacional en la superficie de ese planeta es igual a (g terrestre = 10 m/s<sup>2</sup>)', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(178, NULL, 'Cuando la ventana de una habitaci&oacute;n se encontraba abierta, la cortina de la habitaci&oacute;n se sali&oacute; parcialmente por la ventana. El anterior hecho pudo haber sucedido, porque la velocidad del aire', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(180, NULL, 'Una persona hiperm&eacute;trope no puede ver con nitidez objetos cercanos. Tres estudiantes explican el defecto &oacute;ptico y dan soluci&oacute;n a &eacute;ste de la siguiente manera:<br />\r\nEstudiante 1: sucede, porque la imagen se forma detr&aacute;s de la retina y se corrige con una lente convergente Estudiante 2: sucede, porque la imagen se forma delante de la retina y se corrige con una lente divergente Estudiante 3: sucede, porque la imagen se forma delante de la retina y se corrige con una lente convergente.<br />\r\nEl an&aacute;lisis de estas afirmaciones permiten concluir que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(181, NULL, 'A recipientes iguales que contienen respectivamente 1 litro, 2 litros y 3 litros de agua, se les suministra calor hasta que llegan a sus puntos de ebullici&oacute;n. Respecto a la relaci&oacute;n de estas temperaturas de ebullici&oacute;n se puede afirmar que es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(182, NULL, 'Si la temperatura inicial del agua en los tres recipientes es la misma, la cantidad de calor absorbida por el agua hasta el momento en que alcanza el punto de ebullici&oacute;n es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(183, NULL, 'Una pila el&eacute;ctrica usualmente tiene indicado en sus especificaciones 1,5 voltios. (1 voltio = 1 Joule/coulomb). Entonces 1,5 voltios en una pila significa que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(184, NULL, 'En un circuito en serie de tres bombillos, uno se fundi&oacute;. La corriente en las otras dos bombillas:', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(185, NULL, 'La caja de la guitarra tiene una forma que favorece la resonancia del aire con la onda sonora producida por la cuerda de la guitarra. Supongamos que la guitarra tuviera una caja cuadrada en lugar de la caja actual, es correcto afirmar que en relaci&oacute;n a una guitarra normal', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(186, NULL, 'En una promoci&oacute;n de venta de jab&oacute;n dec&iacute;a: "lleve 2 y pague 1 y 1/2".<br />\r\nEso significa que si compran 2 jabones se:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(187, NULL, 'Diego junt&oacute; un dinero para comprarse una camisa, pero al ir a la tienda se da cuenta de que el precio hab&iacute;a sido aumentado en un 20%. El due&ntilde;o del local le ofrece un descuento de manera que la camisa queda con su precio original ¿Qu&eacute; porcentaje del precio aumentado le debe rebajar el due&ntilde;o para que Diego pague el precio original?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(188, NULL, 'Un vendedor de tel&eacute;fonos celulares tiene dos ofertas de empleo. La compa&ntilde;&iacute;a "Habla Suave" le ofrece un sueldo de $200.000 mensuales m&aacute;s $3.000 por cada tel&eacute;fono vendido.<br />\r\nLa compa&ntilde;&iacute;a "Habla Fuerte" le ofrece un sueldo de $250.000 mensuales m&aacute;s $2.000 por cada tel&eacute;fono vendido.<br />\r\n¿Cu&aacute;ntos tel&eacute;fonos deber&iacute;a vender para recibir el mismo sueldo en ambas compa&ntilde;&iacute;as?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(189, NULL, 'El 10% de 200 igual a:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(191, NULL, 'En relaci&oacute;n a las fracciones de la forma "a/(a+1)", en que "a" es un entero positivo, podemos afirmar que los valores de las fracciones:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(192, NULL, 'Adrian tiene p l&aacute;minas de un &aacute;lbum y Sof&iacute;a tiene p+15 l&aacute;minas.<br />\r\nCon esta informaci&oacute;n es correcto afirmar que:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(194, NULL, '¿A cu&aacute;l de las siguientes operaciones equivale dividir un n&uacute;mero n por 1/5?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
