(196, NULL, 'Claudia participa en una rifa de 150 n&uacute;meros. Si se venden todos los n&uacute;meros y Claudia tiene una probabilidad de 1/15 de ganar, ¿Cu&aacute;ntos n&uacute;meros compr&oacute;?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(197, NULL, 'Daniela tir&oacute; 8 veces un dado no cargado y en todos los tiros obtuvo un 5.<br />\r\n¿Cu&aacute;l es la probabilidad de que en el pr&oacute;ximo lanzamiento obtenga un 5?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
