(257, 257, 'La subida al Monte Fuji solo est&aacute;; abierta al p&uacute;blico desde el 1 de julio hasta el 27 de agosto de cada a&ntilde;o. Alrededor de unas 200.000 personas suben al Monte Fuji durante este periodo de tiempo.<br />\nComo media, ¿alrededor de cu&aacute;ntas personas suben al Monte Fuji cada d&iacute;a?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(258, 258, 'La ruta del Gotemba, que lleva a la cima del Monte Fuji, tiene unos 9 kil&oacute;metros (km) de longitud. Los senderistas tienen que estar de vuelta de la caminata de 18 km a las 20:00 horas (08:00 p.m.)<br />\r\nToshi calcula que puede ascender la monta&ntilde;a caminado a 1,5 kil&oacute;metros por hora, como media, y descenderla al doble de velocidad. Estas velocidades tienen en cuenta las paradas para comer y descansar.<br />\r\nSeg&uacute;n las velocidades estimadas por Toshi, ¿a qu&eacute; hora puede, como muy tarde, iniciar su caminata de modo que pueda estar de vuelta a las 20:00 horas (08:00 p.m.)?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(259, NULL, 'El pod&oacute;metro es un instrumento para medir cu&aacute;ntos pasos da una persona.<br />\r\nSi Juan recorre 9 Km y el pod&oacute;metro le marca 22.500 pasos, calcula la longitud media del paso de Juan, expresada en cent&iacute;metros.', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(260, NULL, 'Una pizzer&iacute;a ofrece dos pizzas redondas del mismo grosor en diferentes tama&ntilde;os. La Pizza 1 tiene 30 cm de di&aacute;metro y cuesta $3000. La Pizza 2 tiene 40 cm de di&aacute;metro y cuesta $4000.<br />\r\n¿Qu&eacute; pizza es la mejor opci&oacute;n en relaci&oacute;n con su costo?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(262, 262, 'Mei-Ling se enter&oacute; de que el tipo de cambio entre el d&oacute;lar de Singapur y el rand sudafricano era de:<br />\r\n1 SGD = 4,2 ZAR<br />\r\nMei-Ling cambi&oacute; 3.000 d&oacute;lares de Singapur en rands sudafricanos con este tipo de cambio.<br />\r\n¿Cu&aacute;nto dinero recibi&oacute; Mei-Ling en rands sudafricanos?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(263, 263, 'Al volver a Singapur, tres meses despu&eacute;s, a Mei-Ling le quedaban 3.900 ZAR. Los cambi&oacute; en d&oacute;lares de Singapur, d&aacute;ndose cuenta de que el tipo de cambio hab&iacute;a cambiado a:<br />\r\n1 SGD = 4,0 ZAR<br />\r\n¿Cu&aacute;nto dinero recibi&oacute; en d&oacute;lares de Singapur?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(264, NULL, 'En el colegio de Irene, su profesora de ciencias les hace ex&aacute;menes que se punt&uacute;an de 0 a 100. Irene tiene una media de 60 puntos de sus primeros cuatro ex&aacute;menes de ciencias. En el quinto examen sac&oacute; 80 puntos.<br />\r\n¿Cu&aacute;l es la media de las notas de Irene en ciencias tras los cinco ex&aacute;menes?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(265, NULL, 'Se emiti&oacute; un documental sobre terremotos y la frecuencia con que &eacute;stos ocurren. El documental inclu&iacute;a un debate sobre la posibilidad de predecir los terremotos.<br />\r\nUn ge&oacute;logo dijo: En los pr&oacute;ximos veinte a&ntilde;os, la posibilidad de que ocurra un terremoto en la ciudad de Zed es dos de tres.<br />\r\n¿Cu&aacute;l de las siguientes opciones refleja mejor el significado de la afirmaci&oacute;n del ge&oacute;logo?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(266, NULL, 'En una pizzer&iacute;a se puede elegir una pizza b&aacute;sica con dos ingredientes: queso y tomate. Tambi&eacute;n puedes dise&ntilde;ar tu propia pizza con ingredientes adicionales. Se pueden seleccionar entre cuatro ingredientes adicionales diferentes: aceitunas, jam&oacute;n, champi&ntilde;ones y salami.<br />\r\nJaime quiere encargar una pizza con dos ingredientes adicionales diferentes.<br />\r\n¿Cu&aacute;ntas combinaciones diferentes podr&iacute;a seleccionar Jaime?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(267, 267, 'La Mir daba vueltas alrededor de la Tierra a una altura aproximada de 400 kil&oacute;metros. El di&aacute;metro de la Tierra mide aproximadamente 12.700 km y su circunferencia es de alrededor de 40.000 km (&#960; × 12.700).<br />\r\nCalcula aproximadamente la distancia total recorrida por la Mir durante sus 86.500 vueltas mientras estuvo en &oacute;rbita. Redondea el resultado a las decenas de mill&oacute;n.', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(268, NULL, 'En Zedlandia, se realizaron varios sondeos de opini&oacute;n para conocer el nivel de respaldo al Presidente en las pr&oacute;ximas elecciones.  Cuatro peri&oacute;dicos hicieron sondeos por separado en toda la naci&oacute;n. Los resultados de los sondeos de los cuatro peri&oacute;dicos se muestran a continuaci&oacute;n:<br />\r\n<br />\r\nPeri&oacute;dico 1: 36,5% (sondeo realizado el 6 de enero, con una muestra de 500 ciudadanos elegidos al azar y con derecho a voto).<br />\r\n<br />\r\nPeri&oacute;dico 2: 41,0% (sondeo realizado el 20 de enero, con una muestra de 500 ciudadanos elegidos al azar y con derecho a voto).<br />\r\n<br />\r\nPeri&oacute;dico 3: 39,0% (sondeo realizado el 20 de enero, con una muestra de 1.000 ciudadanos elegidos al azar y con derecho a voto).<br />\r\n<br />\r\nPeri&oacute;dico 4: 44,5% (sondeo realizado el 20 de enero, con 1.000 lectores que llamaron por tel&eacute;fono para votar).<br />\r\n<br />\r\nSi las elecciones se celebraran el 25 de enero, ¿cu&aacute;l de los resultados de los peri&oacute;dicos ser&iacute;a la mejor predicci&oacute;n del nivel de apoyo al presidente?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(269, 269, '¿Qu&eacute; significa esta publicidad?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(270, NULL, 'Fernando y Miguel han decidido comprarse las mismas botas y ven que en dos zapater&iacute;as distintas est&aacute;n al mismo precio, si bien en una de ellas les aplican un 25% de descuento y en la otra ofertan el segundo par de botas a mitad de precio. Si deciden comprar las botas en la misma tienda, ¿en cu&aacute;l les va a resultar m&aacute;s barato?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(271, NULL, 'Una de las siguientes situaciones NO depende del azar. ¿Cu&aacute;l es?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(272, NULL, '¿Cu&aacute;l de estos n&uacute;meros est&aacute; m&aacute;s pr&oacute;ximo a 4,15?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(273, NULL, 'A un trabajador le descuentan el 15% de su sueldo entre impuestos y seguridad social. La cantidad que percibe despu&eacute;s de los descuentos es 153.000 pts.<br />\r\nSu sueldo es:', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(274, NULL, 'El coste de cada metro cuadrado de c&eacute;sped es de unas 1.000 Pts. Un campo de f&uacute;tbol mide entre 100 y 120 m de largo y entre 64 y 75 m de ancho. ¿Cu&aacute;nto<br />\r\npuede costar el c&eacute;sped de un campo de f&uacute;tbol?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(275, NULL, 'Una hormiga se desplaza, desde el punto P(–5, 4) del plano cartesiano, 5 unidades hacia la derecha y 7 unidades hacia abajo. ¿En qu&eacute; punto se encuentra ahora?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(276, NULL, 'Los lados de un tri&aacute;ngulo miden 7, 8 y 10 dm respectivamente. ¿Cu&aacute;nto mide el lado menor de un tri&aacute;ngulo semejante al anterior cuyo per&iacute;metro es 125 dm?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(277, NULL, '¿Cu&aacute;nto suman los &aacute;ngulos interiores de un pent&aacute;gono regular?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(278, NULL, 'En una clase de 30 alumnos de 11º, los chicos calzan, por t&eacute;rmino medio, un 42 de zapato y las chicas un 39. Si entre todos calzan, por t&eacute;rmino medio, un 40 de zapato, ¿cu&aacute;ntos chicos hay en la clase?', 'TEXTO', 'SIN EXPLICACIÓN', '', 3, 2, 2),
(279, NULL, 'La siguiente reacci&oacute;n muestra la descomposici&oacute;n del per&oacute;xido de hidr&oacute;geno (H<sub>2</sub>O<sub>2</sub>):<br />\r\n<br />\r\n2H<sub>2</sub>O<sub>2</sub> &#8594 2H<sub>2</sub>O + O<sub>2</sub><br />\r\n<br />\r\nUn docente quiere estudiar esta reacci&oacute;n para lo cual adiciona 10 mL de H<sub>2</sub>O<sub>2</sub> en un tubo de ensayo. Cuando el tubo se encuentra a 15ºC observa que la reacci&oacute;n termina a los 15 minutos, mientras que al calentarlo finaliza a los 5 minutos.<br />\r\n¿Qu&eacute; variable ocasiona el cambio de velocidad en la reacci&oacute;n?', 'TEXTO', 'SIN EXPLICACIÓN', '', 8, 4, 6),
(280, NULL, 'Un estudiante propone la siguiente ecuaci&oacute;n para la combusti&oacute;n del metano (CH<sub>4</sub>):<br />\r\n<br />\r\nCH<sub>4</sub> + O<sub>2</sub> &#8594 CO<sub>2</sub> + H<sub>2</sub>O<br />\r\nReactivos  &#8594 Productos<br />\r\n<br />\r\nEl estudiante no est&aacute; seguro de si la ecuaci&oacute;n est&aacute; balanceada, por lo que le pide a su profesor explicarle una de las razones por la cual la ecuaci&oacute;n est&aacute; o no balanceada.<br />\r\n<br />\r\n¿Qu&eacute; deber&iacute;a responderle el profesor?', 'TEXTO', 'SIN EXPLICACIÓN', '', 8, 4, 6),
(281, NULL, 'La primera ley de la termodin&aacute;mica relaciona las cantidades f&iacute;sicas de energ&iacute;a interna (&#916;E), calor (Q) y trabajo (W = P&#916;V) mediante la ecuaci&oacute;n Q = &#916;E + P&#916;V, donde P y V son presi&oacute;n y volumen, respectivamente. A un recipiente cerrado que contiene un gas ideal se le suministra calor por medio de un mechero; si todo el calor se convierte en energ&iacute;a t&eacute;rmica del gas, se sabe que &eacute;ste', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
(282, NULL, 'La eficiencia para una m&aacute;quina t&eacute;rmica se define como:<br />\r\n&#951; = <sup>W</sup>/<sub>Q<sub>A</sub></sub>,<br />\r\n<br />\r\ndonde W es el trabajo realizado por la m&aacute;quina, y Q<sub>A</sub> es el calor suministrado a la m&aacute;quina. Una m&aacute;quina realiza un trabajo W = Q<sub>A</sub> - Q<sub>C</sub>, donde Q<sub>C</sub> es el calor cedido por la m&aacute;quina al medio. La eficiencia para este proceso es menor que 1 porque', 'TEXTO', 'SIN EXPLICACIÓN', '', 7, 4, 6),
