INSERT INTO `tips` (`CODTIP`, `ENCAB`, `DESCTIP`) VALUES
(1, 'En las Pruebss Saber 11', 'Lea muy bien cada pregunta antes de responder.'),
(2, 'En las Pruebss Saber 11', 'Si no sabe la respuesta, no advine. Confíe en lo que usted sabe, en la lógica, en lo que su conocimiento le dice.'),
(3, 'En las Pruebss Saber 11', 'Responda todas las preguntas, no se arriesgue a dejar alguna sin respuesta.'),
(4, 'En las Pruebss Saber 11', 'Si no está seguro de la respuesta de alguna pregunta, verifique bien las respuestas y elija la que mejor corresponda.'),
(5, 'En las Pruebss Saber 11', 'Si no sabe la respuesta de una pregunta y no sabe cómo hallarla, no pierda tiempo y pase a la siguiente pregunta.'),
(6, 'En las Pruebss Saber 11', 'A pesar del tiempo, conserve la calma.'),
(7, 'En las Pruebss Saber 11', '¡Confía en ti!'),
(8, 'En las Pruebss Saber 11', 'No te distraigas mirando a los lados esperando que el compañero le responda.'),
(9, 'En las Pruebss Saber 11', 'Lo más importante en una prueba es la actitud. Tenga una predisposición positiva para resolver con efectividad la prueba.'),
